import React from "react";
import { Link, Outlet } from "react-router-dom";


const Navigation = () => {
    return (
        <>
            <div>
                <Link to="/">
                    <h1>Logo</h1>
                </Link>
                <Link className="links" to="/shop">SHOP</Link>
            </div>
            <Outlet />
        </>
    )
}

export default Navigation;
